import React from 'react';

function Newtweet () {
    const addNewTweet = (e) => {
        alert(e.target.value.newTweetTitle);
        alert(e.target.value.newTweetTitle.value);
    };

    return (
        <form id="newTweet" onSubmit={ addNewTweet }>
            <input
                type="text"
                name="newTweetTitle"
                placeholder="Title"
                required></input>
            <textarea
                name="newTweetText"
                placeholder="Tweet text [maximum 256 characters]"
                maxlength="256"
                required></textarea>
            <input
                type="submit"
                value="Post a new tweet" />
        </form>
    );
}

export default Newtweet;
